        return new Source("{% extends 'base.html.twig' %}

{% block title %}Iniciar Sesion{% endblock %}

{% block body %}
<div class=\"conenedor-contenido\">
{% for mensaje in app.session.flashbag().get(\"mensaje\") %}
\t<strong>{{ mensaje }}</strong>
{% endfor %}
    <h1>Iniciar Sesion</h1>
    
    {% if error %}
    \t<div class=\"alerta alerta-error\">
    \t\t{{ error.messagekey|trans(error.messageData, \"security\") }}
    \t</div>
    {% endif %}

\t<form action=\"{{ path('usuario_accion_autenticarSesion') }}\" method=\"POST\">
\t\t<label for=\"username\">Correo</label>
\t\t<input type=\"email\" id=\"username\" name=\"_username\" value=\"{{ ultimoCorreoUsuario }}\"/> <!-- El name debe ser \"_username\" porque Symfony lo procesa de esa forma. -->
\t
\t\t<label for=\"password\">Clave</label>
\t\t<input type=\"password\" id=\"password\" name=\"_password\"/> <!-- El name debe ser \"_password\" porque Symfony lo procesa de esa forma. -->
\t\t
\t\t<div class=\"clearfix\"></div>
\t\t
\t\t<input type=\"submit\" value=\"Iniciar Sesion\"/>
\t</form>
</div>
{% endblock %}", "usuario/iniciar_sesion.html.twig", "C:\\xampp\\htdocs\\ProyectoSymfony\\templates\\usuario\\iniciar_sesion.html.twig");
